import React from 'react';
import './App.css';
import {BrowserRouter, Route,Redirect} from "react-router-dom";
import Header from './Component/Header/Header';
import Footer from './Component/Footer/Footer';
import Slide from './Component/Slide/Slide';
import windsurf from './Component/Windsurf/Windsurf'
import SlideSearch from './Component/Slide/SlideComponent/SlideSearch';
import NavContainer from './Component/Nav/NavContainer';
import NewProduct from './Component/NewProduct/NewProduct';
import Brand from './Component/Brand/Brand';
import Instagram from './Component/Instagram/Instagram';
import Footer2 from './Component/Footer/Footer2'



const App = () =>{
  return (
    <BrowserRouter>
      <div className="app-wrapper">

          <div className="app-wrapper-content">
             <Route exact path="/">
                 <Redirect to="/windsurf" />
             </Route>

             <Route path="/windsurf" render={ () => <div>
              <Windsurf/>

              </div> }/>
             <Route path="/checkout" render={ () => <div>checkout</div> }/>

             <Route path="/productpage" render={ () => <div>productpage</div> }/>

             <Route path="/surfapparel" render={ () => <div>
             <div className="Blue">
                  <div className="Top">
                    <Header />
                    <SlideSearch />
                  </div>
                </div>
                <div className="White">
                  <div className="Center">
                    <NavContainer />
                  </div>
                </div>
                <div className="Gray">
                  <div className="Bottom">
                    <Footer/>
                  </div>
                </div>
                <div className="Gray2">
                  <div className="Bottom">
                    <Footer2/>
                  </div>
                </div>
              </div> }/>
          </div>

      </div>
    </BrowserRouter>  
  );
}

export default App;
